		<script>
			var TM = TweenMax;
			var tl = gsap.timeline();
			//   var tl = new TimelineMax();
			var clickTag = "https://www.clevertap.com/",
				slowspeed = 0.75,
				speed = 0.35,
				ease = `back`;

			function init() {
				// initHandlers();
				startAnimation();
			}

			function startAnimation() {
				// === Load ===============================
				tl.to("#wrapper", { opacity: 1, duration: speed }, 0)

					.from(
						"#artwork",
						{
							y: "+=20",
							opacity: 0,
							duration: slowspeed,
							ease: ease
						},
						"load"
					)
					.from(
						"#imgball",
						{
							y: "+=10",
							opacity: 0,
							duration: slowspeed + 0.25,
							ease: ease
						},
						"load"
					)
					.from(
						"#bio",
						{
							y: "+=10",
							opacity: 0,
							duration: slowspeed + 0.25,
							ease: ease
						},
						"load+=.2"
					)

					// === Frame 1 ===============================
					.from(
						"#copy-f1",
						{
							x: "-=60",
							opacity: 0,
							duration: slowspeed - 0.15,
							ease: ease
						},
						"frame1-=.3"
					)
					.to(
						"#copy-f1",
						{
							x: "+=60",
							opacity: 0,
							duration: speed,
							ease: ease
						},
						"frame1+=2"
					)

					// === Frame 2 ===============================
					.from(
						"#copy-f2",
						{
							x: "-=60",
							opacity: 0,
							duration: speed,
							ease: ease
						},
						"frame2"
					)
					.to(
						"#copy-f2",
						{
							x: "+=60",
							opacity: 0,
							duration: speed,
							ease: ease
						},
						"frame2+=2"
					)
					.to(
						"#dball-2",
						{
							scale: "1.35",
							x: "+=60",
							y: "+=60",
							duration: 1,
							ease: "power1.inOut"
						},
						"frame2+=2.2"
					)
					.to(
						"#bio",
						{
							x: "+=20",
							opacity: 0,
							duration: speed,
							ease: ease
						},
						"frame2+=2.2"
					)
					.to(
						"#imgball",
						{
							x: "+=60",
							opacity: 0,
							duration: speed,
							ease: ease
						},
						"frame2+=2.4"
					)

					// === Frame 3 ===============================
					.from(
						"#copy-f3",
						{
							x: "-=60",
							opacity: 0,
							duration: speed,
							ease: ease
						},
						"frame3"
					)
					.from(
						"#copy-Finish",
						{
							x: "-=60",
							opacity: 0,
							duration: speed,
							ease: ease
						},
						"frame3-=.25"
					)
					.from(
						"#CTA",
						{
							x: "-=60",
							opacity: 0,
							duration: speed,
							ease: ease
						},
						"frame3"
					)

					// ===== artwork =============================

					//End
					.to(
						"#wrapper",
						{
							// x: "-=60",
							// opacity: 0,
							duration: slowspeed,
							ease: ease
						},
						"frame3+=4"
					)
					.to(
						"#mball-1",
						{
							y: "+=230",
							scale: "1.2",
							duration: tl.duration(),
							ease: "power1.inOut"
						},
						"load"
					);
			}
		</script>
